              this.props.datos.playaCarmen.map(
              (tarjeta) => {
                return(
              <div className="row">
                <div className="col s12 m7">
                  <div className="card">
                    <div className="card-image">
                      <img src="images/sample-1.jpg"/>
                      <span className="card-title">Card Title</span>
                    </div>
